package reparti;

@SuppressWarnings("serial")
public class InvalidInputException extends Exception {
	public InvalidInputException() {
		super("Attenzione, l'input scelto non è valido!");
	}
}

package reparti;

public class Magazzino {
	int scaffale_prod_finiti;
	int scaffale_semilavorati;
	int dim_scaffali;

	public Magazzino(int dim) {
		dim_scaffali = dim;
		scaffale_prod_finiti = 0;
		scaffale_semilavorati = 0;
	}

	public boolean compra() {
		if (scaffale_semilavorati >= dim_scaffali)
			return false;
		else
			scaffale_semilavorati++;
		return true;
	}
	
	public boolean lavora() {
		if (scaffale_semilavorati <= 0)
			return false;
		else
			scaffale_semilavorati--;
		return true;
	}

	public boolean riposiziona() {
		if (scaffale_prod_finiti >= dim_scaffali)
			return false;
		else
			scaffale_prod_finiti++;
		return true;
	}
	
	public boolean vendi() {
		if (scaffale_prod_finiti <= 0)
			return false;
		else
			scaffale_prod_finiti--;
		return true;
	}
}

package reparti;

enum Fasi {ATTESA_POSIZIONAMENTO, RIFINITURA, COLORAZIONE, PREPARAZIONE_LUCIDATURA, LUCIDATURA, ATTESA_PRELIEVO}

public class Produzione {
	Fasi[] fase_linea;
	int[] fase_lucidatura;
	int n_linee;
	
	// inizializza n linee di produzione in ATTESA_POSIZIONAMENTO
	public Produzione(int n) throws InvalidInputException {
		if(n <= 0) throw new InvalidInputException();
		n_linee = 3;
		fase_linea = new Fasi[n_linee];
		for (int i = 0; i < fase_linea.length; i++)
			fase_linea[i] = Fasi.ATTESA_POSIZIONAMENTO;
		fase_lucidatura = new int[n_linee];
	}
	
	// fa procedere di un passo le linee
	public void avanza() {
		for (int i=0; i < fase_linea.length; i++)
			avanzaLinea(i);
	}
	
	// posiziona un prodotto da lavorare sulla linea l (se possibile) e fa avanzare le linee
	public void posiziona(int l) throws InvalidInputException {
		if(l < 0 || l >= n_linee) throw new InvalidInputException();
		if (fase_linea[l] == Fasi.ATTESA_POSIZIONAMENTO)
			fase_linea[l] = Fasi.RIFINITURA;
		else
			l = -1;
		for (int i = 0; i < fase_linea.length; i++) {
			if (i != l)
				avanzaLinea(i);
		}
	}
	
	// preleva un prodotto lavorato dalla linea l (se possibile) e fa avanzare le linee
	public void preleva(int l) throws InvalidInputException {
		if(l < 0 || l >= n_linee) throw new InvalidInputException();
		if (fase_linea[l] == Fasi.ATTESA_PRELIEVO)
			fase_linea[l] = Fasi.ATTESA_POSIZIONAMENTO;
		else
			l = -1;
		for (int i=0; i < fase_linea.length; i++) {
			if (i != l)
				avanzaLinea(i);
		}
	}
	
	// fa procedere la i-esima linea in base alla fase in cui si trova
	private void avanzaLinea(int i) {
		switch (fase_linea[i]) {
			case RIFINITURA:
				fase_linea[i] = Fasi.COLORAZIONE;
				break;
			case COLORAZIONE:
				fase_linea[i] = Fasi.PREPARAZIONE_LUCIDATURA;
				break;
			case PREPARAZIONE_LUCIDATURA:
				if (lucidaturaDisponibile(i)) {
					fase_linea[i] = Fasi.LUCIDATURA;
					fase_lucidatura[i] = 1;
				}
				break;
			case LUCIDATURA:
				if (fase_lucidatura[i] == 1)
					fase_lucidatura[i] = 2;
				else {
					fase_linea[i] = Fasi.ATTESA_PRELIEVO;
					fase_lucidatura[i] = 0;
				}
				break;
			default:
				break;			
		}
	}
	
	// verifica se la i-esima linea può passare alla LUCIDATURA
	private boolean lucidaturaDisponibile(int i) {
		for (int j = 0; j < fase_linea.length; j++) {
			// un altro è entrato nella seconda parte di LUCIDATURA in questa chiamata di preleva(), posiziona() o avanza()
			if (fase_linea[j] == Fasi.LUCIDATURA && fase_lucidatura[j] == 2 && j < i)
				return false;
			// un altro nella prima fase di LUCIDATURA
			if (fase_linea[j] == Fasi.LUCIDATURA && fase_lucidatura[j] == 1)
				return false;
			// un altro è nella seconda parte di LUCIDATURA e ne uscirà in questa chiamata di preleva(), posiziona() o avanza()
			if (fase_linea[j] == Fasi.LUCIDATURA && fase_lucidatura[j] == 2 && j > i) {
				fase_linea[j] = Fasi.ATTESA_PRELIEVO;
				fase_lucidatura[j] = 0;
				return true;
			}
		}
		// nessun caso particolare, posso andare in LUCIDATURA
		return true; 
	}
}

package reparti;

public class RisorseUmane {
	/*@ spec_public @*/ int[] valutazioni;
	
	//@ public invariant valutazioni != null && valutazioni.length > 0;
	/*@ public invariant (\forall int j; 0 <= j && j < valutazioni.length; 
								valutazioni[j] >= 0 && valutazioni[j] <= 100); @*/
	
	//@ requires numDipendenti > 0;
	//@ ensures (\forall int j; 0 <= j && j < valutazioni.length; valutazioni[j] == 50);
	public RisorseUmane(int numDipendenti) {
		valutazioni = new int[numDipendenti];
		//@ loop_invariant i >= 0 && (\forall int j; 0 <= j && j < i; valutazioni[j] == 50);
		for (int i = 0; i < valutazioni.length; i++) {
			valutazioni[i] = 50;
		}
	}
	
	//@ requires i >= 0 && i < valutazioni.length;
	//@ requires giorniLavoro >= 0 && giorniLavoro <= 365;
	//@ requires oreStraordinari >= 0 && oreStraordinari <= 730;
	/*@ ensures (valutazioni[i] == (\old(valutazioni[i]) - 20)) <== 
		((sanzione || (giorniLavoro < 200 && oreStraordinari < 10) && 
		((\old(valutazioni[i] - 20) >= 0)) && 
		((\old(valutazioni[i] - 20) <= 100)))); @*/
	/*@ ensures (valutazioni[i] == (\old(valutazioni[i]) + 20)) <== 
		((giorniLavoro > 240 || oreStraordinari > 50) && 
		((\old(valutazioni[i] - 20) >= 0)) && 
		((\old(valutazioni[i] - 20) <= 100))); @*/
	/*@ ensures (valutazioni[i] == (\old(valutazioni[i]))) <== 
	 	(!(sanzione || (giorniLavoro < 200 && oreStraordinari < 10)) &&
		(!(giorniLavoro > 240 || oreStraordinari > 50))); @*/
	//@ ensures (valutazioni[i] == 100) <== ((\old(valutazioni[i]) + 20) >= 100);
	//@ ensures (valutazioni[i] == 0) <== ((\old(valutazioni[i]) - 20) <= 0);
	public void valuta(int i, int giorniLavoro, int oreStraordinari, boolean sanzione) {
		if (i < 0 || i >= valutazioni.length) return;
		// valutazione negativa
		if (sanzione || (giorniLavoro < 200 && oreStraordinari < 10)) valutazioni[i] -= 20;
		// valutazione positiva
		else if (giorniLavoro > 240 || oreStraordinari > 50) valutazioni[i] += 20;
		if (valutazioni[i] > 100) valutazioni[i] = 100;
		if (valutazioni[i] < 0) valutazioni[i] = 0;
	}
	
	//@ ensures (\forall int j; 0 <= j && j < valutazioni.length; \result <= valutazioni[j]);
	//@ ensures (\exists int j; 0 <= j && j < valutazioni.length; \result == valutazioni[j]);
	public int minVal() {
		int min = valutazioni[0];
		/*@ loop_invariant i >= 0 && i <= valutazioni.length &&
	 	(\forall int j; 0 <= j && j < i; min <= valutazioni[j]) &&
	 	(\exists int j; 0 <= j && j < i; min == valutazioni[j]); @*/
		for (int i = 1; i < valutazioni.length; i++) {
			if (valutazioni[i] < min)
				min = valutazioni[i];
		}
		return min;
	}
	
	//@ ensures (\forall int j; 0 <= j && j < valutazioni.length; \result >= valutazioni[j]);
	//@ ensures (\exists int j; 0 <= j && j < valutazioni.length; \result == valutazioni[j]);
	public int maxVal() {
		int max = valutazioni[0];
		/*@ loop_invariant i >= 0 && i <= valutazioni.length &&
		 	(\forall int j; 0 <= j && j < i; max >= valutazioni[j]) &&
		 	(\exists int j; 0 <= j && j < i; max == valutazioni[j]); @*/
		for(int i = 1; i < valutazioni.length; i++) {
			if (valutazioni[i] > max)
				max = valutazioni[i];
		}
		return max;
	}
}
